import React, { Component } from "react";
import Carousel from "react-bootstrap/Carousel";

class Random extends Component {
  state = {};
  render() {
    return (
      <div>
        <Carousel>
          <Carousel.Item>
            <div>Item1</div>
          </Carousel.Item>
        </Carousel>
      </div>
    );
  }
}

export default Random;
